import styles from "./NavBar.module.css";
import logo from "../images/Helio_logo_nobg.png";

const NavBar = (props) => {
  return (
    <div className={styles.navbar}>
      <div className={styles.navbarLogo}></div>
    </div>
  );
};

export default NavBar;
